import React from 'react';
import "./footer.css";

const Footer = () => {
  return (
    <footer className='footer'>
        <div className="footer__container container">
            <span className="footer__copy">
               &#169; الصراط. جميع الحقوق محفوظة
            </span>
        </div>
    </footer>
  )
}

export default Footer
